import React from "react";
import './App.css';

function Login() {
    return (
        <div className="login">
            <form>
                <h3>Sign In</h3>
                <div>
                    <label htmlFor="email">Email</label>
                    <input type="email" placeholder="Enter Email" className="form-control"/>
                </div>
                <div>
                    <label htmlFor="password">Password</label>
                </div>
            </form>
        </div>
    );
}

export default Login;
